import React, {lazy, Suspense} from 'react';
import ReactDOM from 'react-dom/client';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import {setupAxios} from './adapters/setupAxios';
import './assets/styles/core.scss';
import App from './pages/core/App';
import axios from "axios";

import {Provider} from 'react-redux';

import {
    RecoilRoot,
    atom,
    selector,
    useRecoilState,
    useRecoilValue,
} from 'recoil';
import {QueryClient, QueryClientProvider} from "react-query";
import RecoilNexus from 'recoil-nexus';

const Dashboard = lazy(() => import('./pages/dashboard/dashboard'))

const User = lazy(() => import('./pages/users/user'))

setupAxios(axios)
const root = ReactDOM.createRoot(
    document.getElementById('root') as HTMLElement
);
const queryClient = new QueryClient({
    defaultOptions: {
        queries: {
            refetchOnWindowFocus: false,
            retry: false,
        }
    }
})

root.render(
    <RecoilRoot>
        <RecoilNexus/>
        <QueryClientProvider client={queryClient}>

            <React.StrictMode>
                <BrowserRouter>
                    <Suspense>
                        <Routes>
                            <Route path='/' element={
                                <App/>
                            }>
                                <Route index element={<User/>}/>
                                <Route path="/dashboard" element={<Dashboard/>}/>
                                <Route path="/users" element={<User/>}/>
                                <Route path="/departments" element={<Department/>}/>
                                <Route path="/designations" element={<Designation/>}/>
                                <Route path="/working-shift" element={<WorkingShift/>}/>
                                <Route path="/hour-interest" element={<HourInterst/>}/>
                                <Route path="/holiday" element={<Holiday/>}/>
                                <Route path="/day-leave" element={<DayLeave/>}/>
                                <Route path="/beneficiaries" element={<Beneficiaries/>}/>
                                <Route path="/payrun" element={<Payrun/>}/>
                                <Route path="/monthly-salary-sheet" element={<MonthlySalarySheet/>}/>
                                <Route path="/advance-salary" element={<AdvanceSalary/>}/>
                                <Route path="/attendance" element={<Attendance/>}/>
                                <Route path="/report" element={<Report/>}/>
                                <Route path="/insurance" element={<Insurance/>}/>
                                <Route path="/role" element={<Role/>}/>
                                <Route path="/permission" element={<Permission/>}/>
                                <Route path="/time-keeping" element={<TimeKeeping/>}/>
                                <Route path="/total-monthly-work" element={<TotalMonthlyWork/>}/>
                                <Route path="/attendance-by-phone" element={<AttendanceByPhone/>}/>
                                <Route path="/leave-management" element={<LeaveManagement/>}/>
                                <Route path="/setting-day-leave" element={<SettingDayLeave/>}/>
                                <Route path="/setting-salary-type" element={<SettingSalaryType/>}/>
                                <Route path="/setting-labor-supplier" element={<SettingLaborSupplier/>}/>
                                <Route path="/setting-allowance" element={<Beneficiaries type={"allowance"}/>}/>
                                <Route path="/setting-deduct" element={<Beneficiaries type={"deduct"}/>}/>
                                <Route path="/setting-contract-type" element={<ContractType />} />
                            </Route>
                            <Route path="/login" element={<LoginComponent/>}>
                            </Route>
                        </Routes>
                    </Suspense>
                </BrowserRouter>
            </React.StrictMode>

        </QueryClientProvider>
    </RecoilRoot>
);
